<script>
    class Queue{
        constructor(){
            this.queue = []
        }

        enqueue(element){
this.queue.push(element)
        }

        dequeue(){
            if(this.isEmpty()){
                return "Empty"
            } else {
                return this.queue.shift()
            }
        }

        isEmpty(){
            return this.queue.length === 0
        }

        size(){
            return this.queue.length
        }

        front(){
            if(this.isEmpty()){
                return "Empty"
            } else {
                return this.queue[0]
            }
        }
    }

    const myQueue = new Queue
    myQueue.enqueue(23)
    myQueue.enqueue(3)
    myQueue.enqueue(93)

    myQueue.dequeue()
    

    console.log(myQueue.size())
</script>
